import React, { Fragment } from 'react';

import classes from './Cart.module.css';

const Cart = (props) => {
	return (
		<Fragment>
			<button className={classes.button}>
				<span></span>
				<span>Your Cart</span>
				<span className={classes.badge}>3</span>
			</button>
		</Fragment>
	);
};

export default Cart;
